Notes . PAPIERS  ET CARTONS  ; OUVRAGES  EN PATE 
DE CELLULOSE, EN PAPIER OU EN CARTON  
1.- Aux fins du présent  Chapitre,  et sauf dispositions  contraires,  le terme  papier  couvre  à la fois le carton  et le 
papier,  sans  égard  à leur épaisseur  ou à leur poids  au m2. 
2.- Le présent  Chapitre  ne comprend  pas : 
a)les articles  du Chapitre  30;
b)les feuilles  pour le marquage  au fer, du n° 32.12;
c)Les papiers  parfumés  et les papiers  imprégnés  ou enduits  de produits  cosmétiques  (Chapitre  33);
d)les papiers et l'ouate de cellulose imprégnés, enduits ou recouverts de savon ou de  détergents (n°
34.01),   ou  de  crèmes,   encaustiques,   brillants   ou  préparations   similaires
(n° 34.05);
e)les papiers  et cartons  sensibilisés  des n°s 37.01  à 37.04;
f)les papiers  imprégnés  de réactifs  de diagnostic  ou de laboratoire  (n° 38.22);
g)les matières plastiques stratifiées comportant du papier ou du carton, les produits constitués par une
couche de papier ou  de carton  enduit ou  recouvert d’une  couche de  matière  plastique lorsque l'épaisseur
de cette  dernière  excède  la moitié  de l'épaisseur  totale,  et les ouvrages  en ces matières,  autres  que les
revêtements  muraux  du n° 48.14  (Chapitre  39);
h)les articles  du n° 42.02  (articles  de voyage,

h)les articles  du n° 42.02  (articles  de voyage,  par exemple);
ij) les articles  du Chapitre  46 (ouvrages  de sparterie  ou de vannerie);
k)les fils de  papier  et les articles  textiles  en fils de papier  (Section  XI);
l)les articles  des Chapitres  64 ou 65;
m) les abrasifs  appliqués  sur papier  ou carton  (n° 68.05)  et le mica appliqué  sur papier  ou carton  (n° 68.14);
par contre,  les papiers  et cartons  recouverts  de poudre  de mica relèvent  du présent  Chapitre;
n)les feuilles  et bandes  minces  de métal  sur support  en papier  ou en carton  (généralement  Sections  XIV ou
XV);
o)les articles  du n° 92.09;
p)les articles  du Chapitre  95 (jouets,  jeux, engins  sportifs,  par exemple)  ;
q)les articles  du Chapitre  96 (boutons,  serviettes  et tampons  hygiéniques,  couches,  par exemple).
3.- Sous  réserve  des dispositions  de la Note  7, entrent  dans  les n°s 48.01  à 48.05  les papiers  et cartons  ayant 
subi, par calandrage ou autrement, un lissage, satinage, lustrage, glaçage, polissage ou opérations 
similaires  de finissage  ou bien un faux filigranage  ou un surfaçage,  ainsi que les papiers,  cartons,  ouate  de 
cellulose  et nappes  de fibres  de cellulose,  colorés  ou marbrés  dans  la masse  (autrement  qu’en  surface)  par 
quelque procédé que ce soit.
